import { LockOpenOutlined } from '@material-ui/icons';
import { Avatar } from '@mui/material';
import React from 'react';

const RegristerForm = () => {
    return (
        <div>
            <Avatar>
                <LockOpenOutlined/>
            </Avatar>
        </div>
    );
};

export default RegristerForm;
